import React from 'react';
import './ListItem.css';

import '../test.css';

const ListItems=({items})=>{

    const item = items.map((el) => {
        return  <span key={el.id}>{el.name}</span>
    })
    return(
        <div>
            {item}
        </div>
    )
};

export default ListItems;
